import React, { Component } from "react";

class HomePage extends Component {


    roteSignUp = (e) => {
        this.props.history.push({
            pathname: '/sign-up',
        });
    }

    render() {
        return (
            <div class="div-home-page">
                <svg width="1280" height="960" >
                    <g stroke="null">
                        <title stroke="null">Layer 1</title>
                        <path stroke="#000" transform="rotate(45.08721160888672 -104.05760192871115,633.1649169921875) " id="svg_11" d="m-508.40746,266.90958l0,0c0,-61.83233 41.48686,-111.95732 92.6635,-111.95732l42.11979,0l0,0l202.17495,0l379.07793,0c24.57595,0 48.14526,11.79545 65.52307,32.79154c17.37771,20.99609 27.14048,49.47289 27.14048,79.16579l0,279.89334l0,0l0,167.93595l0,0c0,61.83236 -41.48684,111.95732 -92.66352,111.95732l-379.07793,0l-264.11662,284.68146l61.94167,-284.68146l-42.11979,0c-51.17663,0 -92.6635,-50.12497 -92.6635,-111.95732l0,0l0,-167.93595l0,0l-0.00003,-279.89334z" fill-opacity="null" stroke-opacity="null" stroke-width="1.5" fill="#0E353B" />
                    </g>
                </svg>
                <svg viewbox="0 0 50 50" height="56px">
                    <path d="M1 50 V10 Q1 1 10 1 H50z" fill="#ff4369" />
                </svg>
                <div>
                    <h1 class="title-home-page title-color">Central</h1>
                    <h2 class="sub-title-home-page title-color">de</h2>
                    <h1 class="title-home-page title-color">Erros</h1>

                </div>
                <div class="background-home-page background-color-orange">
                </div>
            </div>


        );
    }
}

export default HomePage;
